import React from 'react'

const Hero2 = () => {
  return (
    <div className="Hero2">
        <div className="left-side">
            <span>Welcome to the <br /> Future of Landings</span>
            <p>Create screens right in your Figma. <br /> Connect different blocks and create <br /> awesome landings. Yes, it just takes a <br /> few minutes!</p>
        </div>
        <div className="Images"></div>
    </div>
  )
}

export default Hero2
